export default function Rightbar() {
    return (
        <div className="rightbar">
            <ul className="rightbar-online-list">
                <li className="rightbar-online-list-item">
                    <img src="assets/avatar/ok.jpg" alt="" className="rightbar-online-list-item-avatar" />
                </li>
            </ul>
        </div>
    )
}
